%   data: {"dataType":"text","outputData":{"text":" <strong>ttest2<\/strong> - Two-sample t-test\n    This MATLAB function returns a test decision for the null hypothesis\n    that the data in vectors x and y comes from independent random samples\n    from normal distributions with equal means and equal but unknown\n    variances, using the two-sample t-test.\n\n    Syntax\n      h = <strong>ttest2<\/strong>(x,y)\n      h = <strong>ttest2<\/strong>(x,y,Name,Value)\n      [h,p] = <strong>ttest2<\/strong>(___)\n      [h,p,ci,stats] = <strong>ttest2<\/strong>(___)\n\n    Input Arguments\n      <a href=\"matlab:web \/Applications\/MATLAB_R2025a.app\/help\/stats\/ttest2.html#btqjrsu-x\">x<\/a> - Sample data\n        vector | matrix | multidimensional array\n      <a href=\"matlab:web \/Applications\/MATLAB_R2025a.app\/help\/stats\/ttest2.html#btqjrsu-y\">y<\/a> - Sample data\n        vector | matrix | multidimensional array\n\n    Name-Value Arguments\n      <a href=\"matlab:web \/Applications\/MATLAB_R2025a.app\/help\/stats\/ttest2.html#btqjrsu_sep_shared-Alpha\">Alpha<\/a> - Significance level\n        0.05 (default) | scalar value in the range (0,1)\n      <a href=\"matlab:web \/Applications\/MATLAB_R2025a.app\/help\/stats\/ttest2.html#btqjrsu_sep_shared-Dim\">Dim<\/a> - Dimension\n        first nonsingleton dimension (default) | positive integer value\n      <a href=\"matlab:web \/Applications\/MATLAB_R2025a.app\/help\/stats\/ttest2.html#btqjrsu-Tail\">Tail<\/a> - Type of alternative hypothesis\n        'both' (default) | 'right' | 'left'\n      <a href=\"matlab:web \/Applications\/MATLAB_R2025a.app\/help\/stats\/ttest2.html#btqjrsu-Vartype\">Vartype<\/a> - Variance type\n        'equal' (default) | 'unequal'\n\n    Output Arguments\n      <a href=\"matlab:web \/Applications\/MATLAB_R2025a.app\/help\/stats\/ttest2.html#btqjrsu_sep_shared-h\">h<\/a> - Hypothesis test result\n        1 | 0\n      <a href=\"matlab:web \/Applications\/MATLAB_R2025a.app\/help\/stats\/ttest2.html#btqjrsu_sep_shared-p\">p<\/a> - p-value\n        scalar value in the range [0,1]\n      <a href=\"matlab:web \/Applications\/MATLAB_R2025a.app\/help\/stats\/ttest2.html#btqjrsu-ci\">ci<\/a> - Confidence interval\n        vector\n      <a href=\"matlab:web \/Applications\/MATLAB_R2025a.app\/help\/stats\/ttest2.html#btqjrsu-stats\">stats<\/a> - Test statistics\n        structure\n\n    Examples\n      <a href=\"matlab:openExample('stats\/TwoSampletTestforEqualMeansExample')\">Two-Sample t-Test for Equal Means<\/a>\n      <a href=\"matlab:openExample('stats\/TTestForEqualMeansWithoutAssumingEqualVariancesExample')\">t-Test for Equal Means Without Assuming Equal Variances<\/a>\n      <a href=\"matlab:openExample('stats\/OneSidedTwoSampleTTestExample')\">One-Sided, Two-Sample t-Test<\/a>\n\n    See also <a href=\"matlab:help ttest -displayBanner\">ttest<\/a>, <a href=\"matlab:help ztest -displayBanner\">ztest<\/a>, <a href=\"matlab:help sampsizepwr -displayBanner\">sampsizepwr<\/a>\n\n    Introduced in Statistics and Machine Learning Toolbox before R2006a\n    <a href=\"matlab:doc ttest2\">Documentation for ttest2<\/a>\n\n","truncated":false}}
